                    <span className="fs-4 d-none d-sm-inline"><NavLink to="/" className="nav-link" end>EasyLi</NavLink></span>
                </a>
                <ul className="nav nav-pills flex-column mt-4">
                    <li className="nav-item py-4">
                        <NavLink to="/" className="nav-link" end>Dashboard</NavLink>
                    </li>
                    <li className="nav-item py-4">
                        <NavLink to="/customers" className="nav-link">Kunden</NavLink>
                    </li>
                    <li className="nav-item py-4">
                        <NavLink to="/registrations" className="nav-link">Zulassungen</NavLink>
                    </li>                                     
                </ul>
            </div>
            <div>                
                <button onClick={logout} className="btn btn-primary"><i className="bi bi-box-arrow-left"></i> Ausloggen</button>                
            </div>
        </nav>
    </header>
}

export default MainNavigation;
